from sympy import divisors
from sympy.core.cache import cacheit
@cacheit
def b(n): return n if n<2 else sum([b(n-k)*sum([b(d)*d*(-1)**(k//d+1) for d in divisors(k)]) for k in range(1, n)])//(n-1)
def a(n): return b(2*n)
